import React from "react";
import Welcome from "./modules/welcome";
import WeeklyNews from "./modules/weekly-news";
import SkillOfTheWeek from "./modules/skill-of-the-week";
import UpcomingWorkouts from "./upcoming-workouts";
import RecentlyAdded from "./modules/recently-added";

const Dashboard = () => {
  return (
    <div>
      <Welcome />
      <WeeklyNews />
      <SkillOfTheWeek />
      <UpcomingWorkouts />
      <RecentlyAdded />
    </div>
  );
};

export default Dashboard;
